import React from "react";
import "./PickList.css";

const Pick = (name, i) => {
  console.log(i);
  return (
    <div className="element" id={i}>
      <p></p>
      <div className="delete">x</div>
    </div>
  );
};

const PickList = ({ name }) => {
  const list = ["탕", "김치"];
  return (
    <tr>
      <td></td>
      <td className={name}>
        {list.length === 0
          ? ""
          : list.map((item, i) => <Pick name={(item, i)} />)}
      </td>
    </tr>
  );
};

export { Pick, PickList };
